import React from "react";
import './styles/skills.css'
export default function Skills(){
    return (
        <div class="card-container card">
          <div class="card-inner custom-card">
            <div class="card-front car-body">
              <p>Front Content</p>
            </div>
            <div class="card-back card-body">
              <p>Back Content</p>
            </div>
          </div>
        </div>
    )
};
